import React from "react";
import Card from './card'
const cards = [
  { title: 'Card 1', content: 'Conteúdo do Card 1' },
  { title: 'Card 2', content: 'Conteúdo do Card 2' },
  { title: 'Card 3', content: 'Conteúdo do Card 3' },

];
const cardss = [
  { title: 'Card 4', content: 'Conteúdo do Card 3' },
  { title: 'Card 5', content: 'Conteúdo do Card 3' },
  { title: 'Card 6', content: 'Conteúdo do Card 3' },
];
export default function Cards() {
  return (
    <section className="w-[100%] h-[100%] flex z-1 items-center pt-[46px] px-[100px] flex-col bg-fuchsia-950">
      <div className="w-[100%] flex items-center flex-col pb-[1px] justify-end ">
        <span className="text-center text-[#ffffff] text-2xl">360° Digital</span>
        <span className="mt-[16px] text-center leading-[30px] text-[#ffffff] mb-[30px] text-[20px]">
          Com nossas tecnologias e profissionais especializados fazemos sua
          empresa decolar nas vendas digitais
        </span>
      </div>
      <div className="w-[100%] flex max-w-7xl items-center flex-row">
        <div className="gap-[32px] w-[100%] flex items-center mb-[32px] flex-col px-[15px]">
        {cards.map((card, index) => (
        <Card key={index} title={card.title} content={card.content} />
       ))}
        </div>
        <div className="gap-[32px] w-[100%] flex items-center mb-[32px] flex-col px-[15px]">
        {cardss.map((card, index) => (
        <Card key={index} title={card.title} content={card.content} />
       ))}
        </div>
      </div>
    </section>
  );
}
